Win="LEGENDARY WIN",e.start_btn="K\xc4YNNISTA",e.freeSpinAward="ILMAISET PELIT MY\xd6NNETTY",e.introtext_1="J\xc4TTIM\xc4INEN\nVOITTO MULTIPLICATOR",e.introtext_2="VOITTOKERROIN ALKAA YHDEST\xc4 JA KASVAA JOKAISEN REAKTION J\xc4LKEEN",e.introtext_3="VOITA YLIM\xc4\xc4R\xc4ISI\xc4 ILMAISKIERROKSIA 3 TAI USEAMMALLA SCATTER-SYMBOLILLA!",e.introtext_4="12",e.outrotext_1="CONGRATULATIONS!",e.outrotext_2="SIN\xc4 VOITIT",e.outrotext_3="00",e.freegameText1="ILMAINEN PELI",e.freegameText2="0",e.freegameText3="/",e.freegameText4="12",e.freegameText5="KOKONAISVOITTO",e.freegameText6="20500",e.freegameText7="MULTIPLICATOR",e.manywaysText="117649",e.maxWinOdds="Max win probability: 1:",e.realityCheckText1="Huomaa:",e.realityCheckText2="Olet pelannut",e.realityCheckText3="tuntia ja",e.realityCheckText4="minuuttia.",e.realityCheckText5="Voit tarkistaa pelihistoriasi kasinon verkkosivuston tiliosiosta.",e.realityCheckText6="JATKA",e.realityCheckText7="POISTUMINEN",e.gameGuideintro1="Tervetuloa GODDESS OF FIRE-pelin pariin!",e.gameGuideintro1_1="T\xe4m\xe4 kolikkopeli tarjoaa pelaajille ainutlaatuisen kokemuksen kutsumalla heid\xe4t aivan toiseen maailmaan, jossa on tulen jumalatar, j\xe4nnitt\xe4vi\xe4 seikkailuja ja jalokivi\xe4.",e.gameGuideHeading2="Peli",e.gameGuideText2_1="Yleiskatsaus",e.gameGuideText2_2="Kiekot:",e.gameGuideText2_3="Tapoja: 117649",e.gameGuideText2_4="Scatter Symboli: F, I, R, E ja Fireball",e.gameGuideText2_5="WILD Symboli: Tulivuori",e.gameGuideText2_6="Ominaisuus: Jos saat nelj\xe4 FIRE-scatteria, voitat ilmaispeli\xe4, joissa on asteittainen kerroin.",e.gameGuideText2_7="RTP:",e.gameGuideText2_8="Min Bet:",e.gameGuideText2_9="Max Bet:",e.gameGuideHeading3="Symbolit ja Voittolinjat",e.gameGuideText3_1="T\xe4ss\xe4 peliss\xe4 on 6 rullaa ja 10 tavallista symbolia. Voitot arvioidaan 117649 tavalla. T\xe4m\xe4 tarkoittaa sit\xe4, ett\xe4 useiden per\xe4kk\xe4isill\xe4 rullilla olevien symbolien sarja - vasemmalta alkaen - muodostaa voittavan yhdistelm\xe4n riippumatta siit\xe4, miss\xe4 kohtaa rullaa se on. Jos symbolit esiintyv\xe4t kiekolla useita kertoja, lasketaan useat tavat.",e.gameGuideText3_2="WILD korvaa kaikki symbolit paitsi Scatterin.",e.gameGuideHeading4="LUOLA RULLA",e.gameGuideText4_1="Jokainen luolakiekko lis\xe4\xe4 symbolin alla olevalle kiekolle (kiekot 2, 3, 4 ja 5).",e.gameGuideHeading5="REAKTIOT",e.gameGuideText5_1="Jokainen voittosymboli on osa reaktiota, ja se korvataan muilla symboleilla jotka tulevat rullien yl\xe4puolelta ja luolan oikealta puolelta.",e.gameGuideHeading6="ILMAISET PELIT",e.gameGuideText6_1="Voit voittaa 12 Ilmaispeli\xe4, kun saat nelj\xe4 FIRE-scatteria.",e.gameGuideText6_2="Jokainen ylim\xe4\xe4r\xe4inen Scatter lis\xe4\xe4 viisi ylim\xe4\xe4r\xe4ist\xe4 Ilmaispeli\xe4.",e.gameGuideHeading7="J\xc4TTIM\xc4INEN VOITTOKERROIN",e.gameGuideText7_1="Voittokerroin alkaa yhdest\xe4 ja kasvaa jokaisen reaktion j\xe4lkeen.",e.gameGuideHeading8="ILMAINEN PELI SCATTER",e.gameGuideText8_1="Ilmaispelin Scatterit n\xe4kyv\xe4t vain luolassa olevilla rullilla.",e.gameGuideText8_2="3 Scatteria = 5 ylim\xe4\xe4r\xe4ist\xe4 Ilmaiset Pelit",e.gameGuideText8_3="4 Scatteria = 10 ylim\xe4\xe4r\xe4ist\xe4 Ilmaiset Pelit",e.gameGuideHeading9_0="Peliohje",e.gameGuideHeading9_1_1="Pelikonsolilla n\xe4ytet\xe4\xe4n seuraavat arvot ja k\xe4ytt\xf6elementit:",e.gameGuideHeading9_1_2="[PANOS]: Peli\xe4 pelataan kiinte\xe4ll\xe4 20 euron panoksella.",e.gameGuideHeading9_1_2_0="Panos valuutassasi on yht\xe4 suuri kuin n\xe4ytetty panos kerrottuna kolikon arvolla.",e.gameGuideHeading9_1_3="[KOLIKKOARVO]: Kulloinkin valitsemasi kolikkoarvo.",e.gameGuideHeading9_1_4="Napsauta [+] tai [-] kolikkoarvosi muuttamiseksi.",e.gameGuideHeading9_1_5="[MAX BET]: Napsauttamalla [MAX BET] asetat panoksesi v\xe4litt\xf6m\xe4sti kolikon enimm\xe4isarvoon.",e.gameGuideHeading9_1_6="Napsauttamalla [MAX BET] kahdesti asetat kolikon enimm\xe4isarvon ja k\xe4ynnist\xe4t py\xf6r\xe4ytyksen.",e.gameGuideHeading9_1_7="[SPIN]: Napsauta [SPIN]-painiketta asettaaksesi panoksesi ja py\xf6ritt\xe4\xe4ksesi rullia kerran. Se v\xe4hent\xe4\xe4 asettamasi summan saldostasi.",e.gameGuideHeading9_1_8="[AUTO PLAY]: Napsauta t\xe4t\xe4 painiketta AutoStart pelin valikon avaamiseksi. Jos kaipaat lis\xe4tietoa, lue kappale AutoStart peli -tila.",e.gameGuideHeading9_1_9="[VOITTO]: Viimeisimm\xe4n py\xf6r\xe4ytyksesi tuoma kokonaisvoitto, omassa valuutassasi.",e.gameGuideHeading9_1_10="[KOLIKOT]: T\xe4m\xe4nhetkinen saldo n\xe4ytet\xe4\xe4n kolikoiden arvona.",e.gameGuideHeading9_1_11="[SALDO]: T\xe4m\xe4nhetkinen saldo omassa valuutassasi.",e.gameGuideHeading9_1_12="Saldo valuutassasi on yht\xe4 suuri kuin n\xe4ytetty kolikkosaldo kerrottuna kolikon arvolla.",e.gameGuideHeading9="Voitonm\xe4\xe4ritys",e.gameGuideText9_1="Kiekot pys\xe4htyv\xe4t per\xe4j\xe4lkeen edeten vasemmalta oikealle.",e.gameGuideText9_2="Kun kiekot ovat pys\xe4htyneet, voittosi lasketaan ja lis\xe4t\xe4\xe4n summaan.",e.gameGuideText9_3="Kaikki voitot alkavat vasemmanpuoleisimmalta rullalta ja maksetaan vasemmalta oikealle per\xe4kk\xe4isill\xe4 rullilla. Voitot kerrotaan panoksella.",e.gameGuideText9_4="Scatter-symboleita ei huomioida voittolinjoissa. Ainoastaan niiden kokonaism\xe4\xe4r\xe4 kiekoissa on olennainen.",e.gameGuideText9_5="Jos tulosta voidaan tulkita usealla eri tavalla, esimerkiksi WILD-symbolien vuoksi, saat suurimman mahdollisen voittoyhdistelm\xe4n.",e.gameGuideText9_6="Kaikki voitot ja voittoyhdistelm\xe4t l\xf6ytyv\xe4t voittotaulukosta.",e.gameGuideText9_7="Jos pelisi keskeytyy voittopelin tai voitonm\xe4\xe4rityksen aikana, t\xe4t\xe4 kierrosta jatketaan pelin uudelleenk\xe4ynnistyksen j\xe4lkeen. Muita kuin voittopelej\xe4 ei jatketa.",e.gameGuideHeading10="Asetukset",e.gameGuideText10_1="Home: Poistu pelist\xe4.",e.gameGuideText10_2="Napsauttamalla ?-painiketta saat ohjeita pelaamiseen ja tietoa pelin s\xe4\xe4nn\xf6ist\xe4.",e.gameGuideText10_3="Saat voittotaulukon esiin napsauttamalla i-painiketta. Taulukossa on tietoja voitoista, voittolinjoista ja pelin ominaisuuksista.",e.gameGuideText10_4="Napsauta painiketta, jossa on \xe4\xe4nisymboli, kytke\xe4ksesi \xe4\xe4nen p\xe4\xe4lle tai pois p\xe4\xe4lt\xe4.",e.gameGuideText10_5="Napsauttamalla hammasratas-symbolia avautuu valikko, jossa voit muuttaa \xe4\xe4nenvoimakkuutta tai poistaa k\xe4yt\xf6st\xe4 ja ottaa k\xe4ytt\xf6\xf6n vaihtoehtoja, kuten turbo spin, koko n\xe4ytt\xf6, musiikki jne.",e.gameGuideText10_6="Asetukset",e.gameGuideText10_7="N\xe4yt\xe4 intro-n\xe4ytt\xf6: Aktivoi tai deaktivoi intro-n\xe4yt\xf6n n\xe4ytt\xe4misen seuraavan vierailun yhteydess\xe4.",e.gameGuideText10_8="Kokoruudun kuva: Napsauta t\xe4t\xe4 painiketta kytke\xe4ksesi Koko ruudun kuva -toiminnon p\xe4\xe4lle tai pois p\xe4\xe4lt\xe4.",e.gameGuideText10_9="Musiikki: Kytkee \xe4\xe4nen p\xe4\xe4lle tai pois p\xe4\xe4lt\xe4.",e.gameGuideText10_10="Py\xf6rit\xe4 v\xe4lily\xf6ntipainikkeella: Mahdollistaa v\xe4lily\xf6nnin py\xf6ritt\xe4misen.",e.gameGuideText10_11="Turbo Spin: Poistaa Turbo Spinin k\xe4yt\xf6st\xe4 tai ottaa sen k\xe4ytt\xf6\xf6n.",e.gameGuideHeading11="AutoStart-toiminto",e.gameGuideText11_0="AutoStart-toiminnon avulla voit k\xe4ynnist\xe4\xe4 valitsemasi m\xe4\xe4r\xe4n pelej\xe4 automaattisesti per\xe4kk\xe4in k\xe4ynnist\xe4m\xe4tt\xe4 jokaista peli\xe4 itse.",e.gameGuideText11_1="AutoStart-toiminto ei k\xe4ynnist\xe4 automaattisesti ilmaispelej\xe4, joten ilmaispelisarja ei voi menn\xe4 sinulta ohi.",e.gameGuideText11_2="Niin kauan kuin AutoStart-tila on aktiivinen, py\xf6ritykset alkavat automaattisesti valitulla vedolla.",e.gameGuideText11_3="Napsauta [AUTO PLAY]-painiketta avataksesi AutoStart-asetusikkunan, jossa voit m\xe4\xe4ritt\xe4\xe4 AutoStart-tilan.",e.gameGuideText11_4="Tarjoamme AutoStart-toiminnosta perusversiota ja asiantuntijaversiota.",e.gameGuideHeading12="Perustoiminto",e.gameGuideText12_1="AutoStart-sarja k\xe4ynnistyy automaattisesti, kun napsautat [AUTO PLAY]-painiketta.",e.gameGuideText12_2="AutoStart-sarja p\xe4\xe4ttyy automaattisesti, kun valittu m\xe4\xe4r\xe4 pelej\xe4 on pelattu.",e.gameGuideHeading13="Asiantuntijatoiminto",e.gameGuideText13_1="Aseta per\xe4kk\xe4in arvot seuraaville asetuksille:",e.gameGuideText13_2="Valitse jokin annetuista AutoStart spin -esiasetuksista.",e.gameGuideText13_3="Pys\xe4yt\xe4 AutoStart mink\xe4 tahansa voiton kohdalla: Jos aktivoit t\xe4m\xe4n kytkimen, AutoStart-sarja lopetetaan automaattisesti, jos sinulla on voitto.",e.gameGuideText13_4="Jos yksitt\xe4inen voitto ylitt\xe4\xe4: K\xe4yt\xe4 liukus\xe4\xe4dint\xe4 asettaaksesi yhden voiton rajan. AutoStart-sarja lopetetaan automaattisesti, kun saavutat n\xe4in suuren tai sit\xe4 suuremman voiton.",e.gameGuideText13_5="Jos saldo kasvaa: K\xe4yt\xe4 liukus\xe4\xe4dint\xe4 voittorajan asettamiseen. AutoStart-sarja lopetetaan automaattisesti, kun SALDO kasvaa t\xe4ll\xe4 m\xe4\xe4r\xe4ll\xe4.",e.gameGuideText13_6="Jos saldo pienenee: K\xe4yt\xe4 liukus\xe4\xe4dint\xe4 tappiorajan asettamiseen. AutoStart-sarja lopetetaan automaattisesti, kun SALDO on pienentynyt t\xe4ll\xe4 m\xe4\xe4r\xe4ll\xe4.",e.gameGuideText13_7="Maasta riippuen voit joutua asettamaan arvon kaikille edell\xe4 mainituille asetuksille tai vain osalle niist\xe4.",e.gameGuideText13_8="Voidaksesi m\xe4\xe4ritt\xe4\xe4 tappiorajan ja voittorajan sinun on ensin valittava automaattisten pelien lukum\xe4\xe4r\xe4.",e.gameGuideText13_9="Website saattaa poistaa k\xe4yt\xf6st\xe4 osan edell\xe4 mainituista asetuksista. Siin\xe4 tapauksessa et voi asettaa arvoa.",e.gameGuideText13_10="Kun olet tehnyt kaikki pakolliset valinnat, voit napsauttaa painiketta [START]. Sen napsauttaminen k\xe4ynnist\xe4\xe4 AutoStart-sarjan.",e.gameGuideText13_11="Jos et halua k\xe4ynnist\xe4\xe4 AutoStart-sarjaa, poistu valikosta napsauttamalla painiketta [CANCEL].",e.gameGuideHeading14="AutoStart-toiminnon lopettaminen",e.gameGuideText14_1="AutoStart-sarja loppuu automaattisesti, kun jokin asettamistasi rajoista on saavutettu.",e.g