megaWin="MEGA WIN",e.winCelebration_legendaryWin="LEGENDARY  WIN",e.start_btn="STARTEN",e.freeSpinAward="GRATIS SPELBEURTEN TOEGEKEND",e.introtext_1="GIGANTISCHE\nWIN VERMENIGVULDIGER",e.introtext_2="DE WINSTVERMENIGVULDIGER BEGINT BIJ \xc9\xc9N EN STIJGT NA ELKE REACTIE",e.introtext_3="WIN EXTRA GRATIS SPINS MET 3 OF MEER SCATTER SYMBOLEN!",e.introtext_4="12",e.outrotext_1="GEFELICITEERD!",e.outrotext_2="U WON",e.outrotext_3="00",e.freegameText1="GRATIS SPELBEURT",e.freegameText2="0",e.freegameText3="VAN",e.freegameText4="12",e.freegameText5="TOTALE WINST",e.freegameText6="20500",e.freegameText7="MULTIPLICATOR",e.manywaysText="117649",e.maxWinOdds="Max winstkans: 1:",e.realityCheckText1="Let op:",e.realityCheckText2="Je hebt",e.realityCheckText3="uur en",e.realityCheckText4="minuten gespeeld.",e.realityCheckText5="Je kunt je spelgeschiedenis bekijken in het accountgedeelte van de casinowebsite.",e.realityCheckText6="DOORGAAN",e.realityCheckText7="AFRIT",e.gameGuideintro1="Welkom bij GODDESS OF FIRE!",e.gameGuideintro1_1="Deze slot geeft spelers een unieke ervaring door hen uit te nodigen naar een heel andere wereld met de godin van het vuur, spannende avonturen en kostbare stenen.",e.gameGuideHeading2="Het spel",e.gameGuideText2_1="Overzicht",e.gameGuideText2_2="Rollen:",e.gameGuideText2_3="Manieren: 117649",e.gameGuideText2_4="Scatter Symbool: F, I, R, E en Fireball",e.gameGuideText2_5="WILD Symbool: Vulkaan",e.gameGuideText2_6="Feature: Krijg vier BRAND Scatter om Gratis Spellen te winnen met een oplopende vermenigvuldiger.",e.gameGuideText2_7="RTP:",e.gameGuideText2_8="Min Inzet:",e.gameGuideText2_9="Max Inzet:",e.gameGuideHeading3="Symbolen en Winlijnen",e.gameGuideText3_1="Dit spel heeft 6 rollen en 10 reguliere symbolen. Winsten worden ge\xebvalueerd op 117649 manieren. Dit betekent dat een opeenvolging van verschillende symbolen op opeenvolgende rollen - beginnend vanaf links - een winnende combinatie vormt, ongeacht de positie op de rol zelf. Als de symbolen meerdere keren op een rol verschijnen, worden meerdere manieren geteld.",e.gameGuideText3_2="WILD vervangt alle symbolen behalve Scatter.",e.gameGuideHeading4="GROT ROLLEN",e.gameGuideText4_1="Elke grottenrol voegt een symbool toe aan de rol eronder (rollen 2, 3, 4 en 5).",e.gameGuideHeading5="REACTIES",e.gameGuideText5_1="Elk winsymbool maakt deel uit van een reactie en wordt vervangen door andere symbolen die van boven op de rollen en van rechts in de grot komen.",e.gameGuideHeading6="GRATIS SPELBEURTEN",e.gameGuideText6_1="Krijg vier FIRE Scatters om 12 Gratis Spelbeurten.",e.gameGuideText6_2="Elke extra Scatter voegt vijf extra Gratis Spelbeurten.",e.gameGuideHeading7="GIGANTISCHE WIN VERMENIGVULDIGER",e.gameGuideText7_1="De winstvermenigvuldiger begint bij \xe9\xe9n en stijgt na elke reactie.",e.gameGuideHeading8="GRATIS SPELBEURT SCATTER",e.gameGuideText8_1="Gratis Spel Scatters verschijnen alleen in grot rollen.",e.gameGuideText8_2="3 Scatters = 5 extra Gratis Spelbeurten",e.gameGuideText8_3="4 Scatters = 10 extra Gratis Spelbeurten",e.gameGuideHeading9_0="Handleiding",e.gameGuideHeading9_1_1="Op de console worden de volgende waarden en bedieningselementen weergegeven:",e.gameGuideHeading9_1_2="[INZET]: Het spel wordt gespeeld met een vaste inzet van 20.",e.gameGuideHeading9_1_2_0="De inzet in uw valuta is gelijk aan de weergegeven inzet vermenigvuldigd met de muntwaarde.",e.gameGuideHeading9_1_3="[MUNTWAARDE]: Jouw momenteel gekozen muntwaarde.",e.gameGuideHeading9_1_4="Klik op [+] of [-] om je muntwaarde aan te passen.",e.gameGuideHeading9_1_5="[MAX INZET]: Als u op [MAX INZET] klikt, wordt uw inzet onmiddellijk ingesteld op de maximale muntwaarde.",e.gameGuideHeading9_1_6="Twee keer klikken op [MAX INZET] stelt de maximale muntwaarde in en start de spin.",e.gameGuideHeading9_1_7="[SPIN]: Klik op de [SPIN]-knop om je inzet te plaatsen en de rollen \xe9\xe9n keer te laten draaien. Het zal uw ingestelde bedrag van uw saldo aftrekken.",e.gameGuideHeading9_1_8="[AUTO PLAY]: Klik op deze knop om het AutoStart menu te openen. Nadere informatie kun je vinden onder Auto Play-modus.",e.gameGuideHeading9_1_9="[WINST]: De totale winst van jouw laatste spin, in jouw valuta.",e.gameGuideHeading9_1_10="[MUNTEN]: Het huidige saldo weergegeven in muntwaarde.",e.gameGuideHeading9_1_11="[SALDO]: Gjeldende saldo i valutaen din.",e.gameGuideHeading9_1_12="Het saldo in uw valuta is gelijk aan het weergegeven muntsaldo vermenigvuldigd met de muntwaarde.",e.gameGuideHeading9="Bepaling van je winst",e.gameGuideText9_1="De rollen stoppen na elkaar van links naar rechts.",e.gameGuideText9_2="Wanneer de rollen gestopt zijn, wordt je winst berekend en opgeteld.",e.gameGuideText9_3="Alle winsten beginnen met de meest linkse rol en betalen van links naar rechts op opeenvolgende rollen. Uitbetalingen worden vermenigvuldigd met de inzet.",e.gameGuideText9_4="Scatter-symbolen op de winlijn worden niet meegerekend. Alleen hun totale aantal op de rollen is relevant.",e.gameGuideText9_5="Als er meerdere mogelijkheden zijn om de winst te interpreteren, bv. wegens WILD-symbolen, dan krijg je de hoogst mogelijke winst.",e.gameGuideText9_6="Alle winsten en winnende combinaties vind je in de Pay-tabel.",e.gameGuideText9_7="Als je spel tijdens een winst of een winstbepaling wordt onderbroken, wordt deze spin bij de herstart van het spel herhaald. Spins die geen winst opleveren, worden niet herhaald.",e.gameGuideHeading10="Instellingen",e.gameGuideText10_1="Home: Be\xebindig het spel.",e.gameGuideText10_2="Klik op de knop [?] voor uitleg over de werking en regels van het spel.",e.gameGuideText10_3="Klik op de knop [i] om de Pay-tabel te zien. Daar vind je informatie over winnen, winlijnen en features van het spel.",e.gameGuideText10_4="Klik op de knop met het geluidssymbool om het geluid aan of uit te zetten.",e.gameGuideText10_5="Klik op de knop met het tandwielsymbool om een menu te openen waarin u het volume kunt wijzigen of om opties zoals turbodraaien, volledig scherm, muziek enz. uit en in te schakelen.",e.gameGuideText10_6="Instellingen",e.gameGuideText10_7="Intro-beeldscherm weergeven: Activeer of deactiveer het weergeven van het intro-beeldscherm bij het volgende bezoek.",e.gameGuideText10_8="Volledig scherm: Klik op deze knop om de functie volledig scherm in of uit te schakelen.",e.gameGuideText10_9="Muziek: Schakelt het volume in of uit.",e.gameGuideText10_10="Spatiebalk voor het draaien indrukken: Hiermee kan de spatiebalk worden gebruikt om te draaien.",e.gameGuideText10_11="Turbo Spin: Schakelt de Turbo Spin in of uit.",e.gameGuideHeading11="AUTOSTART-modus",e.gameGuideText11_0="Met de AUTOSTART-modus kun je een vooraf ingesteld aantal spins automatisch uitvoeren.",e.gameGuideText11_1="Gratis spelbeurten worden in de AUTOSTART-modus niet automatisch gestart; je kunt dus geen gratis spelbeurten missen.",e.gameGuideText11_2="Zolang de AUTOSTART-modus actief is, worden spins automatisch gestart met de geselecteerde weddenschap.",e.gameGuideText11_3="Klik op de knop [AUTO PLAY] om het AutoStart-instellingenvenster te openen, waar u de AutoStart-modus kunt instellen.",e.gameGuideText11_4="De AUTOSTART-modus kent een eenvoudige versie en een expert-versie.",e.gameGuideHeading12="Eenvoudige modus",e.gameGuideText12_1="De AutoStart serie zal automatisch starten na het klikken op de [AUTO PLAY] knop.",e.gameGuideText12_2="De AUTOSTART-serie eindigt automatisch zodra je het ingestelde aantal spins hebt afgewerkt.",e.gameGuideHeading13="Uitgebreide modus",e.gameGuideText13_1="Stel achtereenvolgens waarden voor de volgende opties in:",e.gameGuideText13_2="Kies een van de gegeven AutoStart spin presets.",e.gameGuideText13_3="Stop AutoStart bij elke win: Als u deze schakelaar activeert, wordt de AutoStart-serie automatisch be\xebindigd als u een win heeft.",e.gameGuideText13_4="Als \xe9\xe9n overwinning meer dan: Gebruik de schuifknop om een single win limiet in te stellen. De AutoStart-serie zal automatisch worden be\xebindigd zodra u een winst behaalt die zo hoog of hoger is.",e.gameGuideText13_5="Als het saldo toeneemt met: Gebruik de schuifknop om een winstlimiet in te stellen. De AutoStart-serie wordt automatisch be\xebindigd zodra uw SALDO met dit bedrag is verhoogd.",e.gameGuideText13_6="Als het saldo afneemt met: Gebruik de schuifknop om een verlieslimiet in te stellen. De AutoStart-serie wordt automatisch be\xebindigd zodra uw SALDO met dit bedrag is afgenomen.",e.gameGuideText13_7="Afhankelijk van het land waarin je speelt, moet je een waarde voor al deze opties instellen en alleen enkele daarvan.",e.gameGuideText13_8=" Om een verlieslimiet of een winstlimiet in te stellen, moet je een aantal AutoStart hebben geselecteerd.",e.gameGuideText13_9="Enkele opties kunnen door je website zijn gedeactiveerd. In dat geval kun je geen waarden instellen.",e.gameGuideText13_10="Zodra je alle voorgeschreven opties hebt ingesteld, wordt de knop [START] geactiveerd.",e.gameGuideText13_11="Als je geen AutoStart-serie wilt starten, kun je het menu afsluiten door op [ANNULEREN] te drukken.",e.gameGuideHeading14="AUTOSTART-modus be\xebindigen",e.gameGuideText14_1="De AUTOSTART-serie eindigt automatisch, zodra een van de ingestelde limiet werd bereikt.",e.gameGuideText14_2="Een actieve AutoStart-serie kan worden uitgeschakeld door op de rode knop [AUTO PLAY] te klikken.",e.gameGuideHeading15="Open sessies",e.gameGuideText15_1="Alle open sessies die niet door de speler zijn afgesloten en eventuele toekomstige transacties voor die sessies worden na een bepaalde periode be\xebindigd. Perioden worden bepaald door de respectieve regulator per rechtsgebied:",e.gameGuideText15_2=".COM: 30 dagen",e.gameGuideText15_3="Itali\xeb: 7 dagen",e.gameGuideText15_4="Spanje: 7 dagen",e.gameGuideText15_5="Denemarken: 90 dagen",e.gameGuideText15_6="Zweden: 90 dagen",e.gameGuideText15_7="Roemeni\xeb: 30 dagen",e.gameGuideText15_8="Portugal: 90 dagen",e.gameGuideText16="De uitbetalingskans (RTP) bedraagt ",e.ga