SpinAward="DARMOWYCH GIER PRZYZNANYCH",e.introtext_1="GIGANTYCZNY\nWYGRANEJ MNO\u017bNIK",e.introtext_2="MNO\u017bNIK WYGRANEJ ZACZYNA SI\u0118 OD JEDNEGO I RO\u015aNIE PO KA\u017bDEJ REAKCJI",e.introtext_3="WYGRAJ DODATKOWE DARMOWE SPINY ZA POMOC\u0104 3 LUB WI\u0118CEJ SYMBOLI SCATTER!",e.introtext_4="12",e.outrotext_1="CONGRATULATIONS!",e.outrotext_2="WYGRA\u0141E\u015a",e.outrotext_3="00",e.freegameText1="DARMOWA GRA",e.freegameText2="0",e.freegameText3="Z",e.freegameText4="12",e.freegameText5="CA\u0141KOWITA WYGRANA",e.freegameText6="20500",e.freegameText7="MULTIPLICATOR",e.manywaysText="117649",e.maxWinOdds="Max win probability: 1:",e.realityCheckText1="Uwaga:",e.realityCheckText2="Grasz od",e.realityCheckText3="godzin i",e.realityCheckText4="minut",e.realityCheckText5="Mo\u017cesz sprawdzi\u0107 swoj\u0105 histori\u0119 gry w sekcji konta na stronie kasyna.",e.realityCheckText6="KONTYNUUJ",e.realityCheckText7="WYJ\u015aCIE",e.gameGuideintro1="Witamy w GODDESS OF FIRE!",e.gameGuideintro1_1="Ten slot daje graczom wyj\u0105tkowe do\u015bwiadczenie, zapraszaj\u0105c ich do zupe\u0142nie innego \u015bwiata z bogini\u0105 ognia, porywaj\u0105c\u0105 przygod\u0105 i kamieniami szlachetnymi.",e.gameGuideHeading2="Gra",e.gameGuideText2_1="Przegl\u0105d",e.gameGuideText2_2="B\u0119bny:",e.gameGuideText2_3="Sposob\xf3w: 117649",e.gameGuideText2_4="Symbol Scatter: F, I, R, E i Fireball",e.gameGuideText2_5="Symbol WILD: Wulkan",e.gameGuideText2_6="Cecha: Zdob\u0105d\u017a cztery FIRE Scatter, aby wygra\u0107 Darmowe Gry z przyrostowym mno\u017cnikiem.",e.gameGuideText2_7="RTP:",e.gameGuideText2_8="Min Bet:",e.gameGuideText2_9="Max Bet:",e.gameGuideHeading3="Symbole i Linie wygrywaj\u0105ce",e.gameGuideText3_1="Ta gra ma 6 b\u0119bn\xf3w i 10 regularnych symboli. Wygrane s\u0105 obliczane na 117649 sposob\xf3w. Oznacza to, \u017ce sekwencja kilku symboli na kolejnych b\u0119bnach - zaczynaj\u0105c od lewej - tworzy wygrywaj\u0105c\u0105 kombinacj\u0119, niezale\u017cnie od pozycji na b\u0119bnie. Je\u015bli symbole pojawi\u0105 si\u0119 na b\u0119bnach kilka razy, liczone s\u0105 wielokrotne sposoby.",e.gameGuideText3_2="WILD zast\u0119puje wszystkie symbole opr\xf3cz Scatter.",e.gameGuideHeading4="KO\u0141OWROTKI JASKINIOWE",e.gameGuideText4_1="Ka\u017cdy b\u0119ben jaskini dodaje symbol do b\u0119bna poni\u017cej (b\u0119bny 2, 3, 4 i 5).",e.gameGuideHeading5="REAKCJE",e.gameGuideText5_1="Ka\u017cdy symbol wygranej jest cz\u0119\u015bci\u0105 reakcji i jest zast\u0119powany przez inne symbole pochodz\u0105ce z g\xf3ry na b\u0119bnach i z pra.",e.gameGuideHeading6="DARMOWYCH GIER",e.gameGuideText6_1="Zdob\u0105d\u017a cztery FIRE Scattery, aby wygra\u0107 12 Darmowych Gier.",e.gameGuideText6_2="Ka\u017cdy dodatkowy Scatter dodaje dodatkowe pi\u0119\u0107 Darmowych Gier.",e.gameGuideHeading7="GIGANTYCZNY MNO\u017bNIK WYGRANEJ",e.gameGuideText7_1="Mno\u017cnik wygranej zaczyna si\u0119 od jednego i zwi\u0119ksza si\u0119 po ka\u017cdej reakcji.",e.gameGuideHeading8="SCATTER W DARMOWA GRA",e.gameGuideText8_1="Scattery w grze darmowej pojawiaj\u0105 si\u0119 tylko na b\u0119bnach jaskiniowych.",e.gameGuideText8_2="3 Scattery = 5 dodatkowych Darmowych Gier",e.gameGuideText8_3="4 Scattery = 10 dodatkowych Darmowych Gier",e.gameGuideHeading9_0="Instrukcja gry",e.gameGuideHeading9_1_1="Na konsoli pokazywane s\u0105 nast\u0119puj\u0105ce warto\u015bci i elementy obs\u0142ugi:",e.gameGuideHeading9_1_2="[STAWKA]: Gra odbywa si\u0119 przy sta\u0142ej stawce 20.",e.gameGuideHeading9_1_2_0="Zak\u0142ad w Twojej walucie jest r\xf3wny wy\u015bwietlanemu zak\u0142adowi pomno\u017conemu przez warto\u015b\u0107 monety.",e.gameGuideHeading9_1_3="[WARTO\u015a\u0106 MONET]: Twoja chwilowo wybrana warto\u015b\u0107 monety.",e.gameGuideHeading9_1_4="Kliknij na [+] lub [-], aby dopasowa\u0107 swoj\u0105 warto\u015b\u0107 monety.",e.gameGuideHeading9_1_5="[MAX BET]: Klikni\u0119cie na przycisk [MAX BET] ustawia Twoj\u0105 stawk\u0119 bezpo\u015brednio na najwy\u017csz\u0105 mo\u017cliw\u0105 warto\u015b\u0107!",e.gameGuideHeading9_1_6="Dwukrotne klikni\u0119cie przycisku [MAX BET] spowoduje ustawienie maksymalnej warto\u015bci monet i rozpocz\u0119cie obrotu.",e.gameGuideHeading9_1_7="[SPIN]: Kliknij przycisk [SPIN], aby postawi\u0107 zak\u0142ad i zakr\u0119ci\u0107 b\u0119bnami raz. Spowoduje to odj\u0119cie ustawionej kwoty od stanu konta.",e.gameGuideHeading9_1_8="[AUTO PLAY]: Kliknij na ten przycisk, aby otworzy\u0107 menu AutoStart. W celu uzyskania dalszych informacji czytaj ust\u0119p trybu AutoStart.",e.gameGuideHeading9_1_9="[WYGRANA]: Ca\u0142kowita wygrana Twojego ostatniego spinu w Twojej walucie.",e.gameGuideHeading9_1_10="[MONETY]: Aktualne saldo pokazane w warto\u015bci monet.",e.gameGuideHeading9_1_11="[DOBRO RACHUNKU]: Aktualne saldo w Twojej walucie.",e.gameGuideHeading9_1_12="Saldo w Twojej walucie jest r\xf3wne wy\u015bwietlonemu saldu monet pomno\u017conemu przez warto\u015b\u0107 monety.",e.gameGuideHeading9="Analiza wygranej",e.gameGuideText9_1="B\u0119bny zatrzymuj\u0105 si\u0119 jeden po drugim od lewej do prawej.",e.gameGuideText9_2="Po zatrzymaniu b\u0119bn\xf3w twoje wygrane zostan\u0105 obliczone i zsumowane.",e.gameGuideText9_3="Wszystkie wygrane zaczynaj\u0105 si\u0119 od lewego b\u0119bna i s\u0105 wyp\u0142acane od lewej do prawej na kolejnych b\u0119bnach. Wyp\u0142aty s\u0105 mno\u017cone przez stawk\u0119.",e.gameGuideText9_4="Symbole Scatter nie s\u0105 uwzgl\u0119dniane na liniach wygrywaj\u0105cych. Wa\u017cna jest tylko ich \u0142\u0105czna liczba na b\u0119bnach.",e.gameGuideText9_5="W przypadku gdy istnieje kilka mo\u017cliwo\u015bci zinterpretowania wygranej, np. z powodu symboli WILD, zawsze otrzymujesz najwy\u017csz\u0105 mo\u017cliw\u0105 wygran\u0105 na tej linii.",e.gameGuideText9_6="Wszystkie wygrane i kombinacje wygrywaj\u0105ce znajdziesz w tabeli wyp\u0142at.",e.gameGuideText9_7="Je\u017celi Twoja gra zostanie przerwana podczas wygranej lub analizy wygranej, ten spin zostanie powt\xf3rzony podczas ponownego startu gry. Spiny, z kt\xf3rych nie wynika wygrana, nie zostaj\u0105 powt\xf3rzone.",e.gameGuideHeading10="Ustawienia",e.gameGuideText10_1="Home: Zako\u0144cz gr\u0119.",e.gameGuideText10_2="Kliknij na przycisk [?], aby otrzyma\u0107 wyja\u015bnienie dzia\u0142ania i regu\u0142 gry.",e.gameGuideText10_3="Kliknij przycisk [i], aby uruchomi\u0107 tabel\u0119 wyp\u0142at. Znajdziesz tam informacje dotycz\u0105ce wygranych, linii wygrywaj\u0105cych i funkcji gry.",e.gameGuideText10_4="Kliknij przycisk z symbolem d\u017awi\u0119ku, aby w\u0142\u0105czy\u0107 lub wy\u0142\u0105czy\u0107 d\u017awi\u0119k.",e.gameGuideText10_5="Kliknij przycisk z symbolem ko\u0142a z\u0119batego, aby otworzy\u0107 menu, w kt\xf3rym mo\u017cesz zmieni\u0107 g\u0142o\u015bno\u015b\u0107 lub wy\u0142\u0105czy\u0107 i w\u0142\u0105czy\u0107 opcje takie jak turboobr\xf3t, pe\u0142ny ekran, muzyka itp.",e.gameGuideText10_6="Ustawienia",e.gameGuideText10_7="Pokazanie ekranu wprowadzaj\u0105cego: Aktywuje lub dezaktywuje ekran wprowadzaj\u0105cy podczas nast\u0119pnej wizyty.",e.gameGuideText10_8="Pe\u0142ny ekran: Kliknij na ten przycisk, aby w\u0142\u0105czy\u0107 lub wy\u0142\u0105czy\u0107 funkcj\u0119 pe\u0142nego ekranu.",e.gameGuideText10_9="Muzyka: W\u0142\u0105cza lub wy\u0142\u0105cza d\u017awi\u0119k.",e.gameGuideText10_10="Naci\u015bnij przycisk spacji do obrotu: Umo\u017cliwia u\u017cycie spacji do obracania.",e.gameGuideText10_11="Turbo Spin: Wy\u0142\u0105cza lub w\u0142\u0105cza Turbo Spin.",e.gameGuideHeading11="Tryb AutoStart",e.gameGuideText11_0="Tryb AutoStart umo\u017cliwia automatyczne wykonanie uprzednio ustawionej liczby spin\xf3w.",e.gameGuideText11_1="Gry darmowe w trybie AutoStart nie s\u0105 uruchamiane automarycznie, tym samym nie mo\u017cesz przegapi\u0107 serii gier darmowych.",e.gameGuideText11_2="Tak d\u0142ugo, jak aktywny jest tryb AutoStart, spiny b\u0119d\u0105 uruchamiane automatycznie z wybranym zak\u0142adem.",e.gameGuideText11_3="Kliknij przycisk [AUTO PLAY], aby otworzy\u0107 okno ustawie\u0144 AutoStart, w kt\xf3rym mo\u017cna skonfigurowa\u0107 tryb AutoStart.",e.gameGuideText11_4="Istnieje wesja prosta i wersja dla ekspert\xf3w trybu AutoStart.",e.gameGuideHeading12="Tryb podstawowy",e.gameGuideText12_1="Seria AutoStart rozpocznie si\u0119 automatycznie po klikni\u0119ciu przycisku [AUTO PLAY].",e.gameGuideText12_2="Seria AutoStart ko\u0144czy si\u0119 automatycznie po wykonaniu ustawionej liczby spin\xf3w.",e.gameGuideHeading13="Tryb rozszerzony",e.gameGuideText13_1="Ustaw po kolei warto\u015bci nast\u0119puj\u0105cych opcji:",e.gameGuideText13_2="Wybierz jeden z podanych preset\xf3w spin\xf3w AutoStart.",e.gameGuideText13_3="Zatrzymaj AutoStart przy jakiejkolwiek wygranej: Je\u015bli aktywujesz ten prze\u0142\u0105cznik, seria AutoStart zostanie automatycznie zako\u0144czona w przypadku wygranej.",e.gameGuideText13_4="Je\u015bli pojedyncza wygrana przekracza: U\u017cyj suwaka, aby ustawi\u0107 limit pojedynczej wygranej. Seria AutoStart zostanie automatycznie zako\u0144czona po osi\u0105gni\u0119ciu tak wysokiej lub wy\u017cszej wygranej.",e.gameGuideText13_5="Je\u017celi saldo wzro\u015bnie o: U\u017cyj suwaka, aby ustawi\u0107 limit wygranej. Seria AutoStart zostanie automatycznie zako\u0144czona, gdy Twoje SALDO wzro\u015bnie o t\u0119 kwot\u0119.",e.gameGuideText13_6="Je\u015bli saldo zmniejszy si\u0119 o: U\u017cyj suwaka, aby ustawi\u0107 limit strat. Seria AutoStart zostanie automatycznie zako\u0144czona, gdy Twoje SALDO zmniejszy si\u0119 o t\u0119 kwot\u0119.",e.gameGuideText13_7="Zale\u017cnie od kraju, w kt\xf3rym grasz, musisz ustawi\u0107 warto\u015b\u0107 dla wszystkich lub tylko dla niekt\xf3rych opcji.",e.gameGuideText13_8="Aby ustawi\u0107 limit strat lub limit wygranych, nale\u017cy wybra\u0107 liczb\u0119 AutoStart-\xf3w.",e.gameGuideText13_9="Niekt\xf3re opcje mog\u0105 by\u0107 dezaktywowane przez Twoje website. W tym przypadku nie mo\u017cesz ustawi\u0107 warto\u015bci.",e.gameGuideText13_10="Zaraz po ustawieniu wszystkich przepisowych opcji aktywowany zostaje przycisk [START]. Kliknij na ten przycisk, aby uruchomi\u0107 seri\u0119 AutoStart.",e.gameGuideText13_11="Je\u017celi nie chcesz uruchamia\u0107 serii AutoStart, mo\u017cesz opu\u015bci\u0107 menu przez klikni\u0119cie na [CANCEL].",e.gameGuideHeading14="Zako\u0144czenie trybu AutoStart",e.gameGuideText14_1="Seria AutoStart ko\u0144czy si\u0119 automatycznie zaraz po osi\u0105gni\u0119ciu jednego z ustawionych limit\xf3w.",e.gameGuideText14_2="Aktywna seria AutoStart mo\u017ce zosta\u0107 wy\u0142\u0105czona poprzez klikni\u0119cie czerwonego przycisku [AUTO PLAY].",e.gameGuideHeading15="Sesje otwarte",e.gameGuideText15_1="Wszystkie otwarte sesje, kt\xf3re nie zostan\u0105 zawarte przez gracza i wszelkie przysz\u0142e transakcje dotycz\u0105ce tych sesji zostan\u0105 zako\u0144czone po pewnym czasie. Okresy s\u0105 okre\u015blane przez odpowiedni organ regulacyjny w zale\u017cno\u015bci od jurysdykcji:",e.gameGuideText15_2=".COM: 30 dni",e.gameGuideText15_3="W\u0142ochy: 7 dni",e.gameGuideText15_4="Hiszpania: 7 dni",e.gameGuideText15_5="Dania: 90 dni",e.gameGuideText15_6="Szwecja: 90 dni",e.gameGuideText15_7="Rumunia: 30 dni",e.gameGuideText15_8="Portugalia: 90 dni",e.gameGuideText16="Procentowy zwrot dla gracza (RTP) wynosi ",e.gameGuideText16_1="Warto\u015b\u0107 reprezentuje teoretyczny zwrot z gry w d\u0142u\u017cszym terminie.",e.gameGuideText17="Wadliwe dzia\u0142anie powoduje anulowanie wszystkich gier i wygranych.",e.noInternetPopUpText1="Message",e.noInternetPopUpText2="The internet connection is interrupted. Please restart the game.",e.noInternetPopUpText3="Insufficient funds. Please recharge your balance to continue playing.",e.noInternetPopUpText4="We could not register any activity from you within the last few minutes. Do you want to continue playing?",e.noInternetPopUpText5="An unexpected error has occurred, please restart the game",e.noInt